// const styleForButton = {
//   fontsize: "2.5em",
// };

export default function SelectionPage() {
  return (
    <div className="selectionbox">
      <h1 className="text"> Student Management System </h1>
      <div>
        <Link to="/login">
          <button className="logicbutton">
            {" "}
            <b> Login </b>
            <Login className="loginicon" sx={{ fontSize: "40px" }} />
          </button>
        </Link>
      </div>
    </div>
  );
}
